/*Table structure for table `tac_condition_related` */

DROP TABLE IF EXISTS `tac_condition_related`;

CREATE TABLE `tac_condition_related` (
  `cndr_id` varchar(32) NOT NULL COMMENT '编号',
  `cndr_prop_related_id` varchar(32) DEFAULT NULL COMMENT '属性关联编号',
  `cndr_prop_related` varchar(255) DEFAULT NULL COMMENT '关联属性',
  `cndr_seq` int(10) DEFAULT NULL COMMENT '序号',
  `cndr_prop` varchar(255) DEFAULT NULL COMMENT '属性1',
  `cndr_prop2` varchar(255) DEFAULT NULL COMMENT '属性2',
  `cndr_operate` varchar(255) DEFAULT NULL COMMENT '操作符',
  `cndr_value` varchar(255) DEFAULT NULL COMMENT '值',
  `cndr_value_type` char(10) DEFAULT NULL COMMENT '值类型 enum[class,constant, variant]',
  `isenable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否可用: 1 可用， 0 不可用',
  `addtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `adduser` varchar(32) NOT NULL DEFAULT 'N/A' COMMENT '创建人',
  `modtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `moduser` varchar(32) NOT NULL DEFAULT 'N/A' COMMENT '修改人',
  `acctid` int(11) NOT NULL DEFAULT '1' COMMENT '区域标识',
  `cndr_prop_origin_code` varchar(1024) NOT NULL COMMENT '属性1编码',
  `cndr_prop2_origin_code` varchar(1024) NOT NULL COMMENT '属性2编码',
  `cndr_class1_name_en` varchar(1024) DEFAULT NULL COMMENT '类1英文名称',
  `cndr_prop1_code` varchar(1024) DEFAULT NULL COMMENT '属性1的code',
  `cndr_class2_name_en` varchar(1024) DEFAULT NULL COMMENT '类2英文名称',
  `cndr_prop2_code` varchar(1024) DEFAULT NULL COMMENT '属性2的code',
  `cndr_type_flag` int(11) DEFAULT NULL COMMENT '流程函数类型 1属性 2 函数',
  `class_type_flag` int(11) DEFAULT NULL COMMENT '属性类类型 1 类 2 相关类',
  `link_class_or_class_id` varchar(255) DEFAULT NULL COMMENT '类或者关联类id',
  `link_clss_id` varchar(255) DEFAULT NULL COMMENT '相关类主键id 便于查询',
  `const_type` int(11) DEFAULT NULL,
  `cndt_object_number` varchar(1024) DEFAULT NULL COMMENT '对象编号',
  `edmp_id` varchar(255) DEFAULT NULL COMMENT '对象呈现属性id',
  PRIMARY KEY (`cndr_id`),
  KEY `fk_cndr_prop_related_id` (`cndr_prop_related_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='属性关联条件表';

