  `frmu_formula_text` varchar(500) DEFAULT '' COMMENT '其他系统展示公式内容',
  PRIMARY KEY (`frmu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='公式表';

